import React, { useState } from "react";

import styles from "./Ballot.module.css";

import Race from "../Race/Race";

const Ballot = ({
  ballotID,
  ballotName,
  userID,
  raceOneID,
  raceTwoID,
  raceThreeID,
}) => {
  return (
    <div className={styles.ballot}>
      <h1>{ballotName}</h1>
      {raceOneID != null && <Race />}
      {raceTwoID != null && <Race />}
      {raceThreeID != null && <Race />}
    </div>
  );
};

export default Ballot;
